function drawMap(){function t(t){var n=t.replace(/\s/g,"").toLowerCase();return n}drawMap.prototype.draw=function(n,r,e){d3.csv(r,function(r){for(var a=d3.nest().entries(r),c=0;1>c;c++)d3.select("#"+n).selectAll("#"+n+" li").data(a).enter().append("li").attr("id",function(t){return t.abb}).attr("class",function(n){return t(n[e])}).attr("data-state",function(t){return t.abb}).text(function(t){return t.letter})})}}
